function add(a,b) {
    let sum = a+b;
    return sum;
}
function sub(a,b) {
    let sub = a-b;
    return sub;
}
function multy(a,b) {
    let multy = a*b;
    return multy;
}
function div(a,b) {
    let div = a/b;
    return div;
}
export default add;
